import './App.css';
import * as THREE from 'three';
import {OrbitControls} from 'three/examples/jsm/controls/OrbitControls';
import { extend } from 'react-three-fiber';
import Background from './components/backgroud';
import ConfigForm from './components/configForm';
import TokenForm from './components/tokenForm';
import { BrowserRouter as Router, Routes, Route, Outlet, useNavigate } from 'react-router-dom';


extend({OrbitControls})


function ProtectedWrapper() {
  const navigate = useNavigate();
  const hasSession = document.cookie.includes("session_id_name"); // Replace "session_id_name" with whatever name you're using for the session ID cookie.

  if (!hasSession) {
      navigate('/config');
  }

  return <Outlet />;
}



function App() {
  return (
    <div className="app-container">
      <Background />
      <div className="content-container">
        <Router>
          <Routes>
            <Route exact path="/" element={<TokenForm />} />
            <Route path="/config" element={<ProtectedWrapper />} />
            <Route index element={<TokenForm />} />

          </Routes>
        </Router>

      </div>
  </div>

  );
}

export default App;
